import './Blog.css'

import { Col, Container, Row } from "react-bootstrap";

function Blog(){

    const ArraysOfBlog = [{}];
    const ArraysOfBlogOnMap = ArraysOfBlog.map((ArrayOfBlog) => 
    <Col xl = "4" lg = "4" md = "4" sm = "6" key = {ArrayOfBlog.id}>
        <img src = {ArrayOfBlog.image} className = "w-100"/>
    </Col>
    )

    return(
        <div>
            <Container fluid>
                <div class = "blog">
                    <h3 className = "blog__title">Our Blogs</h3>

                    <Row className = "g-1">
                        {ArraysOfBlogOnMap}
                    </Row>
                </div>
            </Container>
        </div>
    )
}

export default Blog
